<script setup>
//getGuideSuggestions

/* eslint-disable */
import { useRouter } from 'vue-router'
import {computed, ref, watch} from "vue";

import GuideService from '@/services/guideService'
// TODO put in TypeAheadComponent-Component
const router = useRouter()
const query = ref('')
const error = ref(false)
const suggestions = ref([])
const queryLength = computed(() => {
  return query.value.length === 8
})

watch(query, async (newValue) => {
  if (newValue.length >= 1) {
    try {
      const { data } = await GuideService.getGuideSuggestions(newValue)
      suggestions.value = data
    } catch (e) {
      console.error(e)
      suggestions.value = []
    }
  } else {
    suggestions.value = []
  }
})

function checkSearchInput() {
  const match = suggestions.value.find((v) => v.code === query.value)
  if (match) {
    goToGuide(match.guideId)
  } else {
    error.value = true
  }
}

function goToGuide(guideId) {
  router.push(`/guide/${guideId}`)
}

const modal = ref(false)

</script>

<template>
  <!-- Source "sizing" https://getbootstrap.com/docs/4.0/utilities/sizing/ -->
  <div class="w-50">
    <div class="alert alert-warning" role="alert" v-if="error">
      Operation-Code could not be found.
    </div>


    <input
        type="text"
        v-model="query"
        placeholder="Enter OP-Code from alert"
        class="form-control mb-3"
    />

    <ul class="list-group" v-if="suggestions.length">
      <li
          v-for="s in suggestions"
          :key="s.code"
          class="list-group-item list-group-item-action"
          @click="goToGuide(s.guideId)"
      >
        {{ s.code }}
      </li>
    </ul>

    <button
        type="button"
        :class="{
          'btn btn-primary w-100': !queryLength,
          'btn btn-secondary w-100': queryLength
        }"
        style="margin-top: 10px;"
        @click=" !queryLength ? modal = !modal : checkSearchInput()">
        {{ !queryLength ? "Example Alert" : "Search "}} <svg v-if="queryLength" xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-search" viewBox="0 0 16 16">
      <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001q.044.06.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1 1 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0"/>
      </svg>
    </button>

